import lecture5labdef test_e1t1():    assert lecture5lab.calculate_average([]) == 0def test_e1t2():    assert lecture5lab.calculate_average([0,1,2]) == 1    def test_e2t1():    assert lecture5lab.is_prime(7) == True    def test_e2t2():    assert lecture5lab.is_prime(9) == Falsedef test_e2t3():    assert lecture5lab.is_prime(1.5) == "Error 001"def test_e2t4():    assert lecture5lab.is_prime("7") == "Error 002"def test_e3t1():    assert lecture5lab.valid_password("lowerUPPER4") == Truedef test_e3t2():    assert lecture5lab.valid_password("lwtUPR4") == Falsedef test_e3t3():    assert lecture5lab.valid_password("lowerlower4") == Falsedef test_e3t4():    assert lecture5lab.valid_password("UPPERUPPER4") == Falsedef test_e3t5():    assert lecture5lab.valid_password("lowerUPPER") == False